from  urllib2 import urlopen, quote
import xml.etree.ElementTree as et
import codecs as c
from  os.path import abspath, dirname, join
import os

def fetch_padezhy(city_name):
	try:
		url = u"http://export.yandex.ru/inflect.xml?name={0}".format(quote(city_name.encode('utf-8')))
		res = urlopen(url)
		xml = et.fromstring(res.read())
		return [e.text for e in xml.findall("./inflection")]
	finally:
		if res:
			res.close()

